// SPDX-License-Identifier: MIT
pragma solidity 0.8.15;

contract HelloWorld {
    uint256 public time;
    address public addr;
    bool public boolean;
    mapping(uint256 => address) public addresses;

    uint8 public small;

    constructor() {
        time = block.timestamp;
    }

    function gm() external returns (uint256) {
        uint256 prev = time;
        time = block.timestamp;
        return prev;
    }
}

